    false,nt"url": null,nt"notes": "The HOT program makes repeated observations
    of the physics, biology andnchemistry at a site approximately 100 km north of Oahu,
    Hawaii. Two stationsnare visited about once a month: Kahe Point (Station 1: 21.34N,
    158.27W) andnStation ALOHA (Station 2: 22.75N, 158W). Various other stations are
    madenintermittently in support of similar research objectives or mooringndeployments.nnHOT
    thermosalinograph data are recorded every 10 seconds from waterncollected by a continuous
    seawater system aboard each vessel from andepth of about 3 meters.nnThis NODC Accession
    contains thermosalinograph data for HOT cruises 239-248nduring 2012. CTD and Niskin
    bottle data from the same cruisesnare available in separate Accessions.",nt"owner_org":
